script: |
  super -f text -I q11805.spq | sort > q11805.out

inputs:
  - name: q11805.spq
    data: |
      SELECT col2 * col0 * + 2 AS col1 FROM tab2 (FORMAT parquet) AS cor0 WHERE NOT 0 / 36 * col1 IS NOT NULL OR 61 > + ( - - 69 ) - + col1;
  - name: tab2

outputs:
  - name: q11805.out
    data: |
      2116
      5120
      8700
